class Trie:
    def __init__(self):
        self.children = {' ': {}}
        self.end_of_word = False

    def insert(self, word: str) -> None:
        node = self.children
        for char in word:
            if char not in node:
                node[char] = {}
            node = node[char]
        node[' '] = {}
        node['#'] = True

def insert_word_into_trie(trie: Trie, word: str) -> None:
    trie.insert(word)

